import React, { useEffect } from "react";
import { useState } from "react";
import "../ExamMaster/ShowExams.css";
import { useNavigate } from "react-router-dom";

const ShowExams = () => {
  const [data, setData] = useState("");
  const [topicData, setTopicData] = useState([]);
  const [Examname, SetexamName] = useState("");
  const [questionData, setQuestionData] = useState([]);
  const [questionName, setQuestionName] = useState("");
  var examname = null;

  const navigate = useNavigate();
  const deleteRows = (index) => {
    const updatedRows = [...data];
    updatedRows.splice(index, 1);
    setData(updatedRows);
    // fetch("https://localhost:8443/onlineexam/control/deleteexam", {
    //   method: "DELETE",
    // });
  };

  function showForm() {
    console.log("Show form called...");
    document.getElementById("myform").classList.remove("d-none");
    document.getElementById("myform").classList.add("d-block");
  }

  function hideForm() {
    console.log("Show form called...");
    document.getElementById("myform").classList.remove("d-none");
    document.getElementById("myform").classList.add("d-block");
  }
  // function hideForm(){
  //   console.log("Show form called...");
  //   document.getElementById('myform').classList.add('d-none');
  //   document.getElementById('myform').classList.remove('d-block');
